CREATE TABLE `goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '标题',
  `name` varchar(254) NOT NULL DEFAULT '' COMMENT '名称',
  `uuid` varchar(64) NOT NULL DEFAULT '' COMMENT '唯一id',
  `u_id` int(11) NOT NULL DEFAULT '0',
  `site_id` int(11) NOT NULL DEFAULT '0',
  `g_id` int(11) NOT NULL DEFAULT '0' COMMENT '分组id',
  `c_id` int(11) NOT NULL DEFAULT '0' COMMENT '分类id',
  `vendor_id` int(11) NOT NULL DEFAULT '0',
  `sku` varchar(32) NOT NULL DEFAULT '' COMMENT '序号',
  `cover` varchar(254) NOT NULL DEFAULT '' COMMENT '封面',
  `stock` int(11) NOT NULL DEFAULT '0' COMMENT '库存',
  `logistics` varchar(254) NOT NULL DEFAULT '',
  `condition` int(11) NOT NULL DEFAULT '0' COMMENT '成色',
  `price` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '价格',
  `price_original` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '原价',
  `weight` float NOT NULL DEFAULT '0' COMMENT '重量',
  `weight_gross` float NOT NULL DEFAULT '0' COMMENT '毛重',
  `note` varchar(254) NOT NULL DEFAULT '' COMMENT '备注',
  `desc` text NOT NULL COMMENT '描述',
  `sell_count` int(11) NOT NULL DEFAULT '0' COMMENT '购买数量\n',
  `sell_count_today` int(11) NOT NULL DEFAULT '0' COMMENT '今日销量',
  `view_count` int(11) NOT NULL DEFAULT '0' COMMENT '浏览量',
  `view_count_today` int(11) NOT NULL DEFAULT '0' COMMENT '今日浏览量',
  `like_count` int(11) NOT NULL DEFAULT '0' COMMENT '点赞数量',
  `add_cart_count` int(11) NOT NULL DEFAULT '0',
  `add_cart_count_today` int(11) NOT NULL DEFAULT '0',
  `store_count` int(11) NOT NULL DEFAULT '0' COMMENT '收藏数量',
  `comment_count` int(11) NOT NULL DEFAULT '0' COMMENT '评论数量',
  `is_show` int(1) NOT NULL DEFAULT '0',
  `version` int(11) NOT NULL DEFAULT '0' COMMENT '修改一次后 如果商品出售，则版本＋1',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `deleted_at` datetime DEFAULT NULL,
  `g_name` varchar(254) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
